// src/nodes/BaseNode.js

import { Handle, Position } from 'reactflow';

export const BaseNode = ({ id, label, children, handles = [] }) => {
  return (
    <div style={{ width: 200, height: 80, border: '1px solid black', padding: '10px' }}>
      {/* Display label */}
      <div>
        <span><strong>{label}</strong></span>
      </div>

      {/* Render node-specific content */}
      <div>{children}</div>

      {/* Dynamically render handles */}
      {handles.map(({ type, position, id: handleId, style }, index) => (
        <Handle
          key={index}
          type={type}
          position={position}
          id={`${id}-${handleId}`}
          style={style}
        />
      ))}
    </div>
  );
};
